import React from 'react';

const bodyCopy = (props) => {
    return (
        <div>
            <label for="bodycopyinput">Body Copy:</label>
            <textarea
                className="form-control"
                type="text" 
                onChange={props.change} 
                value={props.value} 
                name="bodyCopy"
                rows="3"
                id="bodycopyinput"
            />
        </div>
    )
}

export default bodyCopy;
